import React from 'react';
import logo from './logo.svg';
import './App.css';
import {BrowseRouter} from 'react-router-dom';
import Navbar from './layout/Navbar'

class App extends Component {
  render() {
    return (
      <BrowseRouter>
        <div cclassName="App">
          <Navbar />
        </div>
      </BrowseRouter>
    )
  }
}

export default App;
